// import paraData from "../data/para.json";



const Para = () => {
  return (
    <>
      {paraData.map((para) => {
        return (
          <div className="para" key={para.id}>
            <h2>{para.title}</h2>
            <p>{para.content}</p>
            <button>Learn More...</button>
          </div>
        );
      })}
    </>
  );
};

export default Para;
